import React, { Fragment } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Home from "./components/Home";
import Login from "./components/Login";
import Register from "./components/Register";
import AuthNavbar from "./components/Layouts/AuthNavbar";
import AuthFooter from "./components/Layouts/AuthFooter";
import UserDashboard from "./components/User/UserDashboard";
import Logout from "./components/User/Logout";
import ProductByCategory from "./components/ProductByCategory";
import ProductView from './components/ProductView';
import MyCart from "./components/MyCart";

import PrivateRoutes from "./actions/routes/PrivateRoutes";

const App = () => {

  return (
    <BrowserRouter>
    <Fragment>
    <Switch>
      <AuthNavbar />
        <PrivateRoutes exact path="/user-dashboard" component={UserDashboard} />
        <PrivateRoutes exact path="/sign-out" component={Logout} />
        <PrivateRoutes exact path="/category-product/:id?" component={ProductByCategory} />
        <PrivateRoutes exact path="/view-product/:id?" component={ProductView} />
        <PrivateRoutes exact path="/my-cart" component={MyCart} />
      <AuthFooter />
      </Switch>
      </Fragment>
    </BrowserRouter>
  );
}

export default App;
